import React from 'react';
import './Home.scss';

const Home = () => {
    return (
        <section class="hero is-primary is-large">
            <div class="hero-body">
                <div class="container has-text-centered">
                    <p class="title">Title</p>
                    <p class="subtitle">Subtitle</p>
                </div>
            </div>
        </section>
    )
}

export default Home
